import React, { useEffect } from 'react';
import { listsongs } from '../json/songs';
import Songs  from './Songs';

function SongList() {

    const { songs } = listsongs;
    console.log(songs)
    return (
        <div>
            <h3>Songs List</h3>
            <Songs />
        </div>
    )
}

export default SongList;
